import React, {useState} from 'react';
import {Link} from "react-router-dom";
import {toast, ToastContainer} from "react-toastify";

const RegisterPage = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [email, setEmail] = useState('');
    const [phone_number, setPhoneNumber] = useState('');

    function handleSignUp(e) {
        e.preventDefault();
        const registUser = {username, password, email, phone_number}
        console.log(registUser);
        fetch("http://localhost:8080/chatbot/register", {
            method: "POST",
            headers: {"Content-Type": "application/json"},
            body: JSON.stringify(registUser)
        }).then((responses) => {
            if (username !== '' && responses.ok) {
                console.log('Register Successful');
                toast.success('Login Successful', {
                    position: "top-center",
                    draggable: true,
                    hideProgressBar: true
                });
                // setUsername('');
                // setPassword('');
            } else {
                console.error('Register Failed');
                toast.warn('Something is wrong', {
                        position: "top-center",
                        draggable: true,
                        hideProgressBar: true
                    }
                );
            }
        })
            .catch((error) => {
                console.error('Error:', error);
            });
    }



    return (
        <div>
            <form >
                <div>
                    <h1>Signup</h1>
                    <input type="text" name="uname" placeholder="User name" required
                           value={username} onChange={(e) => setUsername(e.target.value)}/>
                    <input type="password" name="password" placeholder="Password" required
                           value={password} onChange={(e) => setPassword(e.target.value)}/>
                    <input type="email" name="email" placeholder="Email" required
                           value={email} onChange={(e) => setEmail(e.target.value)}/>
                    <input type="tel" name="phone" placeholder="123-456-7890" pattern="[0-9]{3}-[0-9]{3}-[0-9]{4}" required
                           value={phone_number} onChange={(e) => setPhoneNumber(e.target.value)}/>
                    <input id="registerButton" type="submit" value="Register" onClick={handleSignUp}/>
                    <p>Already have an account? </p><Link to="/main">Login</Link>
                </div>
            </form>
            <ToastContainer />
        </div>
    );
};

export default RegisterPage;
